Motor ünitesi sadece kuru bir bezle temizlenmelidir. Anne sütü ile temas eden sağım kiti ve süt saklama kapları elde veya bulaşık makinesinde yıkanabilir. İyice yıkandıktan sonra 5 dakika kaynatılarak ya da Mamajoo Sterilizatörleri ile steril edilebilir. Ürünü temizlemek için parlatıcı, aşındırıcı veya anti-bakteriyel malzemeler kullanmayınız. Hava tüpü bağlantılarının tam oturduğunu düzenli olarak kontrol ediniz.
